// GetNextLunarMonthly tìm ngày dương của [lunarDay] trong tháng âm lịch tiếp theo
// Cách: +40 ngày → rơi vào tháng sau → tìm ngày gần nhất có lunar.Day == lunarDay

// todo phải trả về đúng ngày và đúng giờ luôn để tránh query db nhiều
func FindNextLunarMonthly(inputSolar time.Time, lunarDay int) (time.Time, error) {
	if lunarDay < 1 || lunarDay > 30 {
		return time.Time{}, errors.New("lunar day must be 1-30")
	}

	vnNow1 := inputSolar.In(time.FixedZone("VN", 7*3600)) // Chuyển sang múi giờ Việt Nam
	key := vnNow1.Format("2006-01-02")
	currentLunar, ok := SolarToLunarMap[key] // Lấy ngày âm lịch hiện tại
	targetMonth := currentLunar.Month + 1
	targetYear := currentLunar.Year
	if targetMonth > 12 {
		targetMonth = 1
		targetYear++
	}

	solarConvert, err := LunarToSolar(targetYear, currentLunar.Month, lunarDay, currentLunar.IsLeap)
	if err != nil {
		return time.Time{}, err
	}

	// hãy chuyển solarConvert sang time.Time
	solarConvertTime, err := time.Parse("2006-01-02", solarConvert)
	if err != nil {
		return time.Time{}, err
	}

	if !ok {
		return time.Time{}, errors.New("current date not in cache")
	}

	// BƯỚC 1: +40 ngày → chắc chắn rơi vào tháng âm lịch sau
	start := solarConvertTime.AddDate(0, 0, 40)

	// BƯỚC 3: Tìm ngày có lunar.Day == lunarDay trong khoảng ±20 ngày từ start
	// best := time.Time{}
	// bestDiff := 100

	for offset := -20; offset <= 20; offset++ {
		candidate := start.AddDate(0, 0, offset)
		key := candidate.Format("2006-01-02")
		lunar, ok := SolarToLunarMap[key]
		if !ok {
			continue
		}

		// Phải đúng năm, tháng âm lịch
		if lunar.Year != targetYear || lunar.Month != targetMonth {
			continue
		}

		// Phải đúng ngày âm lịch
		if lunar.Day != lunarDay {
			if lunarDay-lunar.Day > 3 {
				offset += lunarDay - lunar.Day - 2
			}
			continue
		}
		return candidate.UTC(), nil

		// Tìm ngày gần nhất
		// diff := int(candidate.Sub(solarConvertTime).Hours() / 24)
		// if diff < 0 {
		// 	diff = -diff
		// }
		// if diff < bestDiff {
		// 	bestDiff = diff
		// 	best = candidate
		// }
	}

	// if best.IsZero() {
	// 	return time.Time{}, errors.New("next lunar date not found")
	// }

	// viết return
	return time.Time{}, errors.New("next lunar date not found")
}

// SolarToLunar: "2025-06-01" → {2025, 5, 5, false}
func SolarToLunar(solarDate string) (LunarDateMap, error) {
	if ld, ok := SolarToLunarMap[solarDate]; ok {
		return ld, nil
	}
	return LunarDateMap{}, fmt.Errorf("không tìm thấy ngày dương: %s", solarDate)
}

// LunarToSolar: 2025, 5, 5, false → "2025-06-01"
//
//	2025, 5, 5, true  → "2025-06-30"
func LunarToSolar(year, month, day int, isLeap bool) (string, error) {
	key := fmt.Sprintf("%d-%02d-%02d", year, month, day)
	if isLeap {
		key += "-true"
	}

	if solar, ok := LunarToSolarMap[key]; ok {
		return solar, nil
	}
	return "", fmt.Errorf("không tìm thấy ngày âm: %d-%02d-%02d (nhuận: %v)", year, month, day, isLeap)
}

